import React, { Component } from 'react'


class AttractionDetails extends Component {

  componentDidMount = () => {
      const array = this.props. attractionInfo;
      const attraction = array.find(a => a.Id === this.props.match.params.Id);
      console.log(attraction);
  }

  render() {
      if (true) {
        return (
          <div className="container section project-details">
            <div className="card z-depth-0">
              <div className="card-content">
                <span className="card-title">Attractie Titel</span>
                <p>Attractie Content</p>
              </div>
              <div className="card-action grey lighten-4 grey-text">
                <div>Posted by </div>
                <div>2nd September, 2am</div>
              </div>
            </div>
          </div>
        )
      } else {
        return (
          <div className="container center">
            <p>Loading attraction...</p>
          </div>
        )
      }
    }
  }

export default AttractionDetails;
